import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

import "bootstrap/dist/css/bootstrap.css";

ReactDOM.render(
  <KBarProvider actions={actions}>
    <KBarContent>
      <KBarSearch />
      <KBarResults />
    </KBarContent>
    <App />
  </KBarProvider>,
  document.getElementById("root")
);
